import "./App.css";
import * as React from "react";
import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";
import axios, * as others from "axios";
function App() {
  const [selectedVendor, setSelectVendor] = React.useState("");
  const [optionsVendor, setOptionsVendor] = React.useState([]);

  React.useEffect(() => {
    const fetchData = async () => {
      axios.get("/api/vendors").then(
        (response) => {
          console.log(response);
          if (response.status === 200) {
            setOptionsVendor(response.data);
            console.log(response.data);
          } else {
            console.log(`Status code ${response.status}`);
          }
        },
        (error) => {
          console.log(error);
        }
      );
    };
    fetchData();
  }, []);
  const fetchData = async (select) => {
    axios.get("/api/vendors").then(
      (response) => {
        console.log(response);
        if (response.status === 200) {
          setOptionsVendor(response.data);
          console.log(response.data);
        } else {
          console.log(`Status code ${response.status}`);
        }
      },
      (error) => {
        console.log(error);
      }
    );
  };

  return (
    <>
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={optionsVendor.map((item) => item.name)}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="name" />}
        onChange={(event, value) => {
          console.log(value);
          setSelectVendor(value);
        }}
      />
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={optionsVendor.map((item) => item.name)}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="name" />}
        onChange={(event, value) => {
          console.log(value);
          setSelectVendor(value);
        }}
      />
    </>
  );
}

export default App;
